In clinical trials, dosage was initiated at 0.375 mg/day and gradually titrated based on individual therapeutic response and tolerability. Doses greater than 4.5 mg/day have not been studied in clinical trials. Patients should be assessed for therapeutic response and tolerability at a minimal interval of 5 days or longer after each dose increment [see Clinical Studies (
                           14
                           )].

Due to the flexible dose design used in clinical trials, specific dose-response information could not be determined [see Clinical Studies (
                           14
                           )].

Before initiating treatment with pramipexole dihydrochloride extended-release tablets, advise patients of the potential to develop drowsiness, and specifically ask about factors that may increase the risk for somnolence such as the use of concomitant sedating medications or alcohol, the presence of sleep disorders, and concomitant medications that increase pramipexole plasma levels (e.g., cimetidine) [see Clinical Pharmacology (
                           12.3
                           )]. If a patient develops significant daytime sleepiness or episodes of falling asleep during activities that require active participation (e.g., conversations, eating, etc.), pramipexole dihydrochloride extended-release tablets should ordinarily be discontinued. If a decision is made to continue pramipexole dihydrochloride extended-release tablets, advise patients not to drive and to avoid other potentially dangerous activities that might result in harm if the patients become somnolent. While dose reduction reduces the degree of somnolence, there is insufficient information to establish that dose reduction will eliminate episodes of falling asleep while engaged in activities of daily living.

Patients with a major psychotic disorder should ordinarily not be treated with dopamine agonists, including pramipexole dihydrochloride extended-release tablets, because of the risk of exacerbating the psychosis. In addition, certain medications used to treat psychosis may exacerbate the symptoms of Parkinson's disease and may decrease the effectiveness of pramipexole dihydrochloride extended-release tablets [see Drug Interactions (
                           7.1
                           )].

The elimination of pramipexole is dependent on renal function [see Clinical Pharmacology (
                           12.3
                           )]. Patients with mild renal impairment (a creatinine clearance above 50 mL/min) require no reduction in daily dose. Pramipexole dihydrochloride extended-release tablets have not been studied in patients with moderate to severe renal impairment (creatinine clearance <50 mL/min) or on hemodialysis [see Dosage and Administration (
                           2.2
                           ), Use in Specific Populations (8.6), and Clinical Pharmacology (
                           12.3
                           )].

Pathologic changes (degeneration and loss of photoreceptor cells) were observed in the retina of albino rats in a 2-year carcinogenicity study. While retinal degeneration was not diagnosed in pigmented rats treated for 2 years, a thinning in the outer nuclear layer of the retina was slightly greater in rats given drug compared with controls. Evaluation of the retinas of albino mice, monkeys, and minipigs did not reveal similar changes. The potential significance of this effect for humans has not been established, but cannot be disregarded because disruption of a mechanism that is universally present in vertebrates (i.e., disk shedding) may be involved [see Nonclinical Toxicology (
                           13.2
                           )].

Although not reported with pramipexole in the clinical development program, a symptom complex resembling the neuroleptic malignant syndrome (characterized by elevated temperature, muscular rigidity, altered consciousness, and autonomic instability), with no other obvious etiology, has been reported in association with rapid dose reduction, withdrawal of, or changes in dopaminergic therapy. If possible, avoid sudden discontinuation or rapid dose reduction in patients taking pramipexole dihydrochloride extended-release tablets. If the decision is made to discontinue pramipexole dihydrochloride extended-release tablets, the dose should be tapered to reduce the risk of hyperpyrexia and confusion [see Dosage and Administration (
                           2.2
                           )].

