General Disorders and Administration Site Conditions: withdrawal symptoms [see Warnings and Precautions (
5.11
)]

Musculoskeletal and Connective Tissue Disorders: postural deformity [see Warnings and Precautions (
5.6
)]

The elimination of pramipexole is dependent upon renal function. Pramipexole clearance is extremely low in dialysis patients, as a negligible amount of pramipexole is removed by dialysis [see Dosage and Administration (
                           2.2
                           ), Warnings and Precautions (
                           5.7
                           ), and Clinical Pharmacology (
                           12.3
                           )].

Relative bioavailability of pramipexole dihydrochloride extended- release tablets compared with immediate-release tablets was approximately 100%. In a repeat-dose study in healthy, normal volunteers, pramipexole dihydrochloride extended- release tablets 4.5 mg administered once daily was bioequivalent with regard to Cmax and AUC over 24 hours to immediate-release pramipexole tablets 1.5 mg administered three times daily. The average time-to-peak concentration for pramipexole dihydrochloride extended-release tablets is 6 hours. Administration of pramipexole dihydrochloride extended- release tablets with food (i.e., high-fat meal) did not affect AUC but increased Cmax by approximately 20% and delayed Tmax by approximately 2 hours compared with dosing under fasted conditions; these differences are not considered to be clinically relevant [see Dosage and Administration (
                           2.1
                           )].

Because therapy with pramipexole dihydrochloride extended-release tablets is initiated at a low dose and gradually titrated upward according to clinical tolerability to obtain the optimum therapeutic effect, adjustment of the initial dose based on gender, weight, race, or age is not necessary. However, renal insufficiency causes a large decrease in the ability to eliminate pramipexole. This will necessitate dosage adjustment in patients with moderate to severe renal impairment [see Dosage and Administration (
                           2.2
                           )].

Clearance of immediate-release pramipexole was about 75% lower in patients with severe renal impairment (creatinine clearance approximately 20 mL/min) and about 60% lower in patients with moderate impairment (creatinine clearance approximately 40 mL/min) compared with healthy volunteers [see Dosage and Administration (
                           2.2
                           ) and Warnings and Precautions (
                           5.7
                           )]. In patients with varying degrees of renal impairment, pramipexole clearance correlates well with creatinine clearance. Therefore, creatinine clearance can be used as a predictor of the extent of decrease in pramipexole clearance.

Pramipexole dihydrochloride extended-release tablets should be swallowed whole. They should not be chewed, crushed, or divided [see Dosage and Administration (
                     2.1
                     )].

Inform patients that residue in stool which may resemble a swollen original pramipexole dihydrochloride extended-release tablets or swollen pieces of the original tablet have been reported [see Adverse Reactions (
                     6.2
                     )]. Instruct patients to contact their physician if this occurs.

Alert patients to the potential sedating effects of pramipexole dihydrochloride extended-release tablets, including somnolence and the possibility of falling asleep while engaged in activities of daily living. Since somnolence is a frequent adverse reaction with potentially serious consequences, patients should neither drive a car nor engage in other potentially dangerous activities until they have gained sufficient experience with pramipexole dihydrochloride extended-release tablets to gauge whether or not it affects their mental and/or motor performance adversely. Advise patients that if increased somnolence or new episodes of falling asleep during activities of daily living (e.g., conversations or eating) are experienced at any time during treatment, they should not drive or participate in potentially dangerous activities until they have contacted their physician. Because of possible additive effects, advise caution when patients are taking other sedating medications or alcohol in combination with pramipexole dihydrochloride extended-release tablets and when taking concomitant medications that increase plasma levels of pramipexole (e.g., cimetidine) [see Warnings and Precautions (
                     5.1
                     )].

Advise patients that they may develop postural (orthostatic) hypotension, with or without symptoms such as dizziness, nausea, fainting, or blackouts, and sometimes, sweating. Hypotension may occur more frequently during initial therapy. Accordingly, caution patients against rising rapidly after sitting or lying down, especially if they have been doing so for prolonged periods and especially at the initiation of treatment with pramipexole dihydrochloride extended-release tablets [see Warnings and Precautions (
                     5.2
                     )].

Alert patients and their caregivers to the possibility that they may experience intense urges to spend money, intense urges to gamble, increased sexual urges, binge eating and/or other intense urges and the inability to control these urges while taking pramipexole dihydrochloride extended-release tablets [see Warnings and Precautions (
                     5.3
                     )].

Inform patients that hallucinations and other psychotic-like behavior can occur. In patients with Parkinson's disease, the elderly are at a higher risk than younger patients [see Warnings and Precautions (
                     5.4
                     )].

Advise patients who have been prescribed a lower dose or who have been withdrawn from the drug to notify their healthcare provider if they have symptoms such as fever, muscular rigidity or altered consciousness [see Warnings and Precautions (
                     5.10
                     )].

Advise patients that withdrawal symptoms may occur during or after discontinuation or dose reduction of pramipexole dihydrochloride extended-release tablets. Advise patients who have been prescribed a lower dose or who have been withdrawn from the drug to notify their healthcare provider if they have withdrawal symptoms such as apathy, anxiety, depression, fatigue, insomnia, sweating, or pain. Notify patients that in case of severe withdrawal symptoms, a trial re-administration of a dopamine agonist at the lowest effective dose may be considered [see Warnings and Precautions (
                     5.11
                     )].

Because the teratogenic potential of pramipexole has not been completely established in laboratory animals, and because experience in humans is limited, advise women to notify their physicians if they become pregnant or intend to become pregnant during therapy [see Use in Specific Populations (
                     8.1
                     )].

Because of the possibility that pramipexole may be excreted in breast milk, advise women to notify their physicians if they intend to breast-feed or are breast-feeding an infant [see Use in Specific Populations (
                     8.2
                     )].
